use REGFIELDTRIALS
go

-- ran insert statement TO trialprogress to complete all 2014 trials, except for workflow_id = 16
BEGIN TRAN
           ,[SRRUser_ID]
           ,[Workflow_ID]
           ,[WorkflowComplete]
           ,[WorkflowCompleteDate]
           ,[UpdateDateTime]
           ,[UpdateUserID])
SELECT T.Trial_ID, ISNULL(x.SRRUser_ID,4), w.Workflow_ID, 1, GETDATE(), GETDATE(), 'JASPAR'
FROM [REGFIELDTRIALS].[dbo].[TrialCatalog] T
	left outer join
		 SRRUser_Trial_Xref x on x.Trial_ID = t.Trial_ID and x.IsDeleted = 0 
	CROSS JOIN workflow w 
WHERE T.TrialYear = 2014 
	AND T.IsDeleted = 0 
	AND W.ISDELETED =0
	AND W.Workflow_ID <> 16     

rollback tran
commit tran

